    <!-- 
        使用img标签引入外部图片，img是自结束标签
        属性
            src属性指定外部图片的路径
            alt属性是对图片的描述
                搜索引擎会根据alt中的内容进行识别
                如果不写alt，那么搜索引擎不会被搜索
            width 指定图片的宽度（单位是像素）
            height 图片的高度
        img是替换元素，不独占一行
        一般情况，不建议在pc端修改图片大小，需要多大的图片就裁多大
        在移动端，经常需要对图片进行缩放（大图缩小）
     -->
     <img src="./img/gif/WWF.gif" >
     <img src="./img/gif/WWF.gif" alt="描述" width="500" height="500">
     <br>
     <p>外部引用</p>
     <img src="https://timgsa.baidu.com/timg?image&quality=80&size=b9999_10000&sec=1595221310505&di=bf64e142f715f2bc067b1e2c118b7989&imgtype=0&src=http%3A%2F%2Fwww.veelink.com%2Fupload%2Fusers%2F1%2F20150112%2F1337667811951.jpg">
     <!-- 
         图片的格式
         jpeg
            支持的颜色比较丰富,不支持透明效果,不支持动图
            一般用来显示照片
        gif
            支持颜色比较少,支持简单透明,支持动图
            颜色单一的图片,动图
        png
            支持颜色丰富,支持复杂透明,不支持动图
            颜色丰富,复杂透明图片(专为网页而生)
        webp
            谷歌新推出的专门用来表示网页中图片的格式
            具备其他格式的所有优点
            效果好,文件小
            缺点:兼容性不好
        base64
            将图片进行base64编码,可以直接将图片转换为字符,通过字符的格式来引入
            一般都是需要和网页一起加载的图片才会使用base64
        效果一样,用小的


      -->
